style.css:
/* ==UserStyle==
@name           Yellow Links and URLs
@namespace      https://example.com
@version        1.0
@description    Make all links and URLs yellow
@include        *
==/UserStyle== */

a,
a:link,
a:visited,
a:hover,
a:active,
a:focus,
:not(a) {
    color: yellow !important;
}
